import math
def divs(n):
    large_divisors = []
    for i in range(1, int(math.sqrt(n) + 1)):
        if n % i == 0:
            yield i
            if i !=  n // i:
                large_divisors.insert(0, n / i)
    for divisor in large_divisors:
        yield divisor
a = 2
while a < 1000000000:
    q = list(divs(a))[:-1]
    r = sum(q)
    if r > a or len(q) == 1:
        pass
    elif r == a:
        print(a)
    else:
        c = 1
        while r < a:
            q.append(r)
            r = sum(q[c:])
            c += 1
        if r == a:
            print(a)
    a += 1
